import Todolist from './todolist'
import haveFinished from './haveFinished'
function Index() {
    return (
        <ThemeProvider theme={theme}>
            <CSSReset/>
            <Todolist/>
            <haveFinis/>
        </ThemeProvider>
    );
}
export default Index
